//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_ENGINE_CONTROL_OPTIONS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e ENGINE_CONTROL_OPTIONS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := ENGINE_CONTROL_OPTIONS_ALLOW_START_WHILE_DISARMED.MarshalText()
		require.NoError(t, err)

		var dec ENGINE_CONTROL_OPTIONS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, ENGINE_CONTROL_OPTIONS_ALLOW_START_WHILE_DISARMED, dec)
	})
}
